import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';

const rootElement = document.getElementById('root'); // Ищем элемент с id="root"
if (rootElement) {
    ReactDOM.render(<App />, rootElement); // Рендерим React-компонент
} else {
    console.error('Контейнер с id "root" не найден в DOM.');
}
